// LoadThings allows an eager lookup of values, cached into the
// loaded structs of the objects. This is for a 1-M or N-M relationship.
func (shareL) LoadThings(ctx context.Context, e boil.ContextExecutor, singular bool, maybeShare interface{}, mods queries.Applicator) error {
	var slice []*Share
	var object *Share

	if singular {
		var ok bool
		object, ok = maybeShare.(*Share)
		if !ok {
			object = new(Share)
			ok = queries.SetFromEmbeddedStruct(&object, &maybeShare)
			if !ok {
				return errors.New(fmt.Sprintf("failed to set %T from embedded struct %T", object, maybeShare))
			}
		}
	} else {
		s, ok := maybeShare.(*[]*Share)
		if ok {
			slice = *s
		} else {
			ok = queries.SetFromEmbeddedStruct(&slice, maybeShare)
			if !ok {
				return errors.New(fmt.Sprintf("failed to set %T from embedded struct %T", slice, maybeShare))
			}
		}
	}

	args := make(map[interface{}]struct{})
	if singular {
		if object.R == nil {
			object.R = &shareR{}
		}
		args[object.ID] = struct{}{}
	} else {
		for _, obj := range slice {
			if obj.R == nil {
				obj.R = &shareR{}
			}
			args[obj.ID] = struct{}{}
		}
	}

	if len(args) == 0 {
		return nil
	}

	argsSlice := make([]interface{}, len(args))
	i := 0
	for arg := range args {
		argsSlice[i] = arg
		i++
	}

	query := NewQuery(
		qm.Select("\"things\".\"id\", \"things\".\"name\", \"things\".\"created_at\", \"things\".\"owner_id\", \"things\".\"description\", \"things\".\"private_note\", \"things\".\"quantity_unit\", \"a\".\"share_id\""),
		qm.From("\"things\""),
		qm.InnerJoin("\"shares_things\" as \"a\" on \"things\".\"id\" = \"a\".\"thing_id\""),
		qm.WhereIn("\"a\".\"share_id\" in ?", argsSlice...),
	)
	if mods != nil {
		mods.Apply(query)
	}

	results, err := query.QueryContext(ctx, e)
	if err != nil {
		return errors.Wrap(err, "failed to eager load things")
	}

	var resultSlice []*Thing

	var localJoinCols []string
	for results.Next() {
		one := new(Thing)
		var localJoinCol string

		err = results.Scan(&one.ID, &one.Name, &one.CreatedAt, &one.OwnerID, &one.Description, &one.PrivateNote, &one.QuantityUnit, &localJoinCol)
		if err != nil {
			return errors.Wrap(err, "failed to scan eager loaded results for things")
		}
		if err = results.Err(); err != nil {
			return errors.Wrap(err, "failed to plebian-bind eager loaded slice things")
		}

		resultSlice = append(resultSlice, one)
		localJoinCols = append(localJoinCols, localJoinCol)
	}

	if err = results.Close(); err != nil {
		return errors.Wrap(err, "failed to close results in eager load on things")
	}
	if err = results.Err(); err != nil {
		return errors.Wrap(err, "error occurred during iteration of eager loaded relations for things")
	}

	if len(thingAfterSelectHooks) != 0 {
		for _, obj := range resultSlice {
			if err := obj.doAfterSelectHooks(ctx, e); err != nil {
				return err
			}
		}
	}
	if singular {
		object.R.Things = resultSlice
		for _, foreign := range resultSlice {
			if foreign.R == nil {
				foreign.R = &thingR{}
			}
			foreign.R.Shares = append(foreign.R.Shares, object)
		}
		return nil
	}

	for i, foreign := range resultSlice {
		localJoinCol := localJoinCols[i]
		for _, local := range slice {
			if local.ID == localJoinCol {
				local.R.Things = append(local.R.Things, foreign)
				if foreign.R == nil {
					foreign.R = &thingR{}
				}
				foreign.R.Shares = append(foreign.R.Shares, local)
				break
			}
		}
	}

	return nil
}

